import React from 'react';
import Nav from "../components/main/Nav";
import SignUpBox from "../components/main/SignUpBox";
import SignUpBoxCard from "../components/main/SignUpBoxCard";

const Index = () => {
    return (
        <div>
          <Nav />
          <div>
              <SignUpBox />
              <SignUpBoxCard />
          </div>
        </div>
    );
};

export default Index;
